import {Navbar} from "./Navbar";

export const Home = () => {
  return (
    <div>
    <div className="home">    
      <Navbar/>    
      
    </div>
    <iframe id="inlineFrameExample"
    title="Inline Frame Example"
    src="src/images\lifedent_presentation.mp4">
</iframe>
    </div>  
  );
};
